import React, { Component } from 'react';
// Custom Components
import HeaderOne from './components/common/headers/header-one';
import FooterOne from "./components/common/footers/footer-one";
import PushMenu from 'react-push-menu';
import LinkComponent from "./lib/menuPush/LinkComponent";
import { Container, } from 'react-floating-action-button'




import { FloatingButton, Item } from "react-floating-button";
import others from './iconos/facebook2.svg'
import contacto from './iconos/contacts.svg'
import what from './iconos/whats.svg'
import pho from './iconos/phone.svg'

import './lib/menuPush/component.scss';


class App extends Component {

    constructor(props) {
        super(props);
        this.state = {
            isLoading: true,
        }
        this.closeClick = this.closeClick.bind(this);
        this.openClick = this.openClick.bind(this);
        this.toggleClick = this.toggleClick.bind(this);
        this.onCreate = this.onCreate.bind(this);

        this.load();
    }

    load = () => {
        fetch('./api/menu.json')
            .then((response) => response.json())
            .then((res) => {
                this.menu = res;
                this.setState({ isLoading: false })
                document.querySelector(".loader-wrapper").style = "display: none";
            })
    };
    onCreate() {
        this.sidebarObj.element.style.visibility = '';
    }
    open() {
        console.log("Sidebar is opened");
    }
    close() {
        console.log("Sidebar is closed");
    }
    // Open the Sidebar
    openClick() {
        this.sidebarObj.show();
    }
    // Toggle(Open/Close) the Sidebar
    toggleClick() {
        this.sidebarObj.toggle();
    }
    // Close the Sidebar
    closeClick() {
        this.sidebarObj.hide();
    }


    render() {
        return !this.state.isLoading && (
            <>
                <div class="hea">
                    <HeaderOne logoName={'logo.png'} menu={this.menu} />
                </div>
                <div className="opal-wrapper">
                    <PushMenu
                        backIcon={<i className="fa fa fa-arrow-left"></i>}
                        expanderComponent={() => {
                            return (<i className="fa fa-chevron-right"></i>)
                        }}
                        autoHide={true}
                        nodes={{ children: this.menu }}
                        type={'cover'}
                        linkComponent={LinkComponent}
                        propMap={{ url: 'link' }}>


                        <div id="page" className="site">
                            {this.props.children}
                            <FooterOne logoName={'logo.png'} />
                        </div>

                    </PushMenu>
                </div>
                {/* <Container >
                    <Link href="https://www.instagram.com/landparktlajomulco/?igshid=YzA2ZDJiZGQ%3D"
                        tooltip="Telefono"
                        styles={{ backgroundColor: 'blue ', color: 'white',  }}
                        icon="fa fa-phone icons"  />
                    <Link href="#"
                        tooltip="Whatsapp"
                        styles={{ backgroundColor: '#25D366', color: 'white',  }}
                        icon="fa fa-whatsapp icons" />
                    <Link href="https://www.facebook.com/LandParkTlajomulco"
                        tooltip="Facebook"
                        styles={{ backgroundColor: '#3b5998', color: 'white', }}
                        icon="fa fa-facebook icons1" />

                    <Button
                        className="fab-item"
                        styles={{ backgroundColor: '#cabe9f', color: 'black',  }}
                        tooltip="Contacto"
                        icon="fa fa-arrow-up "
                        rotate={true}
                        
                        />


                    
                </Container> */}
              

              <div className="control-section">
                <div id="wrapper">
                    
                    <SidebarComponent id="default-sidebar" ref={Sidebar => this.sidebarObj = Sidebar} style={{ visibility: "hidden" }} close={this.close} open={this.open} created={this.onCreate}>
                        <div className="title"> Sidebar content</div>
                        <div className="sub-title">
                            Click the button to close the Sidebar.
                         </div>
                        <div className="center-align">
                            <ButtonComponent onClick={this.closeClick} id="close" className="e-btn close-btn">Close Sidebar</ButtonComponent>
                        </div>
                    </SidebarComponent>
                    <div>
                        <div className="title">Main content</div>
                        <div className="sub-title"> Click the button to Open the Sidebar.</div>
                        <div className="center-align">
                            <ButtonComponent onClick={this.openClick} id="open" className="e-btn e-info">Open Sidebar</ButtonComponent>
                        </div>
                        <div className="sub-title"> Click the button to open/close the Sidebar.</div>
                        <div className="center-align">
                            <ButtonComponent onClick={this.toggleClick} id="toggle" className="e-btn e-info">Toggle Sidebar</ButtonComponent>
                        </div>
                    </div>
                </div>
            </div>
                
{/* 

                <Container>
                    <FloatingButton
                        right={true}
                        size={80}
                        backgroundColor={'#cabe9f'}
                        color={'black'}
                        imgSrc={contacto}
                    >

                        <Item
                            imgSrc={others}
                            backgroundColor={'#cabe9f'}
                            onClick={() => window.location = 'https://www.facebook.com/LandParkTlajomulco'}
                        />
                        <Item
                            imgSrc={what}
                            backgroundColor={'#cabe9f'}

                            onClick={() => {
                                console.log("callback function here");
                            }}
                        />
                        <Item
                            imgSrc={pho}
                            backgroundColor={'#cabe9f'}
                            onClick={() => {
                                console.log("callback function here");
                            }}
                        />

                    </FloatingButton>;

 */}
                {/* </Container> */}


            </>
        );
    }
}

export default App;
